import VueRouter from 'vue-router';


const Foo = {template:"<div>foo</div>"};
const Bar = {template:"<div>bar</div>"};

const routers  = [
    {
        path : '/foo',
        component : Foo,
    },
    {
        path : '/bar',
        component : Bar,
    }
]

const router = VueRouter({
    routers
})

export default {
    router
}
